import React,{useState,useEffect} from "react";

function Users(){
    const [users,setUsers] = useState([]);
    useEffect(()=>{
          fetch('https://jsonplaceholder.typicode.com/users')
          .then((res) => res.json)
          .then((data)=> setUsers(data));
    }, []);
    return(
        <div>
            <h3>Users List:</h3>
            <ol>
                {users.map(user  =>{
                    return<li key={user.id}>  {users.name} </li>
                } )}
            </ol>
        </div>
    )
}
export default Users
